import React from 'react';
import images from "../Utilities/ImageDirectories/CampusWatchImages.json"
import Profile from './Profile';
import ReverseProfile from './ReverseProfile';
import FadeIn from './FadeIn';

function Page() {
  return (
    <div className="min-h-screen flex flex-col" id='outreaches'>
      <header className="bg-gray-200 py-4 px-8">
        <h1 className="text-3xl font-bold">OUTREACHES DONE BY THE MINISTRY</h1>
      </header>
      <FadeIn/>
      <ReverseProfile title={"God's Alternative to Bloodshed, Plateau, Nigeria 2013"} imagesrc={"images/campuswatch/20240817_123919.jpg"} text={"A vision From the Lord About Plateau State Triggered A Prayer Work on the 19th of April 2013"}/>
    </div>
  );
}

export default Page;
